import React from 'react';
import './App.css';

const Navigation = () => {
  return (
    <nav>
      <ul>
      <li><a href="#">Karla Ferreira</a></li>
        <li><a href="#">Home</a></li>
        <li><a href="#sobre">Sobre</a></li>
        <li><a href="#projetos">Projetos</a></li>
        <li><a href="https://github.com/kfrural#contato">Contato</a></li>
      </ul>
    </nav>
  );
}

const Section = () => {
  return (
    <section>
      <h2>Bem-vindo ao meu site!</h2>
      <p>Meu nome é Kfrural e este é o meu site pessoal.</p>
      <a href="https://github.com/kfrural">Visite meu perfil no GitHub</a>
    </section>
  );
}

const ProjectSection = () => {
  return (
    <section>
      <h2>Meus Projetos</h2>
      <ul>
        <li>
          <h3>Projeto 1</h3>
          <p>Descrição do Projeto 1</p>
          <a href="https://github.com/kfrural/projeto1">Ver Projeto 1</a>
        </li>
        <li>
          <h3>Projeto 2</h3>
          <p>Descrição do Projeto 2</p>
          <a href="https://github.com/kfrural/projeto2">Ver Projeto 2</a>
        </li>
        {/* Adicione mais projetos aqui */}
      </ul>
    </section>
  );
}

const Footer = () => {
  return (
    <footer>
      <p>&copy; 2023 Kfrural. Todos os direitos reservados.</p>
    </footer>
  );
}

const App = () => {
  return (
    <div>
      <header>
        <Navigation />
      </header>

      <main>
        <Section />
        <ProjectSection />
        {/* Outras seções */}
      </main>

      <Footer />
    </div>
  );
}

export default App;
